import ChartOne from "./chartOne";
import ChartTwo from "./chartTwo";
import ClientCarousel from "./clientCarousel";
import Action from "./Action";
import PubArtHttp from "./PubArtHttp";
import Divider from "./divider";
import { Route, BrowserRouter as Router, Switch } from "react-router-dom";
import Intro from "../profileComponent/Intro";
import Shift from "../profileComponent/Shift";
import Article from "./Article";
import FicheEmployer from "../profileComponent/FicheEmployer";
function Body() {
  return (
    <Router>
      <div className="row">
        <Divider />
        <Route
          path="/profil"
          component={
            <div className="col-md-11 ">
              <div className="row me-4">
                <Intro />
              </div>
              <div className="row">
                <div className="col-sm-4">
                  {" "}
                  <Shift />{" "}
                </div>
                <div className="col-sm-4">
                  {" "}
                  <Shift />{" "}
                </div>
                <div className="col-sm-4">
                  {" "}
                  <Shift />{" "}
                </div>
              </div>
              <div className="row me-1">
                <div className="col-md-8">
                  <Article />
                  <Article />
                  <Article />
                </div>
                <div className="col-md-4 ">
                  <FicheEmployer />
                </div>
              </div>
            </div>
          }
        />

        <Route
          path="/"
          component={
            <div className=" col  mb-2 me-4 ">
              <div className="mx-3">
                <div className="row ">
                  <ChartOne />
                  <ChartTwo />
                  <ClientCarousel />
                </div>
                <div className="row ">
                  <Switch>
                    <Route path="/" exact component={Article} />
                    <Route path="/post-article" component={PubArtHttp} />
                  </Switch>
                  <Action />
                </div>
              </div>
            </div>
          }
        />
      </div>
    </Router>
  );
}
export default Body;
